import { createApp } from 'vue';
import App from './App.vue';
import LoginForm from "./components/loginForm.vue";  // Corrected component name
import Dashboard from "./components/attendanceForm.vue";  // Corrected component name
import Navigation from "./components/theNavigation.vue"
import Leave from "./components/leaveForm.vue";  // Corrected component name
import AttendanceLevel from "./components/attendanceLevel.vue";  // Corrected component name

import { createRouter, createWebHistory } from 'vue-router';

const routes = [
  {
    path: '/',
    component: LoginForm,
    name: 'login',
  },
  {
    path: '/dashboard',
    component: Dashboard,
    name: 'dashboard',  // Corrected name
  },
  {
    path: '/navigation',
    component: Navigation,
    name: 'navigation',
  },
  {
    path: "/leave",
    component: Leave,  // Corrected component name
  },
  {
    path: "/attendanceLevel",
    component: AttendanceLevel,  // Corrected component name
  }
];

const router = createRouter({
  history: createWebHistory(),
  linkActiveClass: 'active-link',  // Replace with your desired class name
  routes,
});

const app = createApp(App);
app.use(router);
app.component('LoginForm', LoginForm);
app.component('Dashboard', Dashboard);  // Corrected component name
app.component('Navigation', Navigation);
app.component('Leave', Leave);  // Corrected component name
app.component('AttendanceLevel', AttendanceLevel);  // Corrected component name
app.mount('#app');
